import React, { useContext} from 'react';
import UserContext from '../utils/UserContext';

const UserProfileForm = () => {
    const { currentUser } = useContext(UserContext)
    return (
        <div className="UserProfileForm">
            <h1 className="Form-h1"> Your Profile </h1>
            <form>
                <label className="Form-label">Username</label>
                <input className="Form-input" type="text" value={currentUser.username} disabled="true"></input>

                <label className="Form-label">Preferred name</label>
                <input className="Form-input" type="text"></input>

                <label className="Form-label">Email</label>
                <input className="Form-input" type="text"></input>

                <button className="Form-button">Save Changes</button>
            </form>
        </div>
    )
}

export default UserProfileForm;
